first_prompt:
You will be given a multiple-choice question. Your task is to select the two most likely correct answers from the list of options, based on reasoning and evidence.

For each selected option:
- Provide the number of the answer.
- Write a concise justification explaining why it is a strong candidate.

⚠️ IMPORTANT:
- Do NOT select more than two options.
- Do NOT include any information or analysis about options you do NOT select.
- Do NOT include extra commentary or headers.
- Follow the format *exactly* as shown below.

QUESTION:
As punishment for bad behavior during recess, Mrs. Busywork asked her class to multiply 10 by $\frac{1}{3}$ five times. John, however, notices that it is possible to multiply 10 by a single fraction and still get the same answer as the other students. What is this single fraction?
OPTIONS:
0. \frac{1}{243}
1. \frac{1}{2}
2. \frac{1}{729}
3. \frac{1}{100}
4. \frac{1}{3}
5. \frac{1}{27}
6. \frac{1}{68}
7. \frac{1}{64}
8. \frac{1}{125}
9. \frac{1}{81}

====================
✅ EXPECTED ANSWER FORMAT:
Option: 0
Justification: This option directly addresses the main point of the question and aligns with known facts or logical reasoning.

Option: 3
Justification: This option is also supported by relevant evidence and complements the reasoning in Option 1.
